import Nav from "../components/Nav";
import Footer from "../components/Footer";
import styles from "../css/App.module.css";

function Notice() {
  return (
    <div>
      <Nav />
      <h2 className={styles.page_title}>Notice</h2>
      <Footer />
    </div>
  );
}
export default Notice;
